import React, { useState, useEffect } from "react";

export default function DemoUseEffect() {
  let [number, setNumber] = useState(1);
  const handleIncrease = () => {
    setNumber({
      number: number + 1,
    });
  };

  return (
    <div>
      <button className="btn btn-success" onClick={handleIncrease}>
        Tang
      </button>
    </div>
  );
}
